Category	Feature, Couples

Director	Stormy Daniels
Starring	Stormy Daniels, Xander Corvus, Steven St Croix, Juelz Ventura, Mischa Brooks, Michael Vegas, Bailey Blue, Tommy Pistol, Katie St Ives, Karlo Karrera, Casey Calvert, Lyla Storm, Brendon Miller

Join Stormy Daniels (writer/director) as she weaves separate tales about the insatiable sexual appetites of our favorite type of women...Nymphos! Daniels is an escort that gets off on fucking someone new, while other scenarios include a massage therapist who prefers to rub her clients below the waist, a high-powered boss who uses her position to get what she wants and a trio of desperate groupies who'll do anything for their favorite band. Not for the faint of heart, as Nymphos delivers &quot;over the top&quot; scorching sex!

